import React from "react";
import AutoCompleteCity from "../../common/autoComplete";

class RideTaken extends Form {
  state = {
    data: {
      fromCity: "",
    },
    errors: {},
  };

  schema = {
    fromCity: Joi.string().required().label("From"),
  };

  render() {
    return (
      <div>
        Ride Taken Info page
        <AutoCompleteCity name="from" label="From" />
      </div>
    );
  }
}

export default RideTaken;
